pragma solidity >=0.4.25 <0.6.0;

contract Ownable {
    address public owner;

    constructor() public {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner);
        _;
    }
}

contract Pausable is Ownable {
    event Pause();
    event Unpause();

    bool public paused = false;

    modifier whenNotPaused() {
        require(!paused);
        _;
    }

    modifier whenPaused() {
        require(paused);
        _;
    }

    function pause() onlyOwner whenNotPaused public {
        paused = true;
        emit Pause();
    }

    function unpause() onlyOwner whenPaused public {
        paused = false;
        emit Unpause();
    }
}

library SafeMath {
    function mul(uint256 a, uint256 b) internal pure returns (uint256) {
        if (a == 0) {
            return 0;
        }
        uint256 c = a * b;
        assert(c / a == b);
        return c;
    }

    function div(uint256 a, uint256 b) internal pure returns (uint256) {
        assert(b > 0); // Solidity automatically throws when dividing by 0
        uint256 c = a / b;
        // assert(a == b * c + a % b); // There is no case in which this doesn't hold
        return c;
    }

    function sub(uint256 a, uint256 b) internal pure returns (uint256) {
        assert(b <= a);
        return a - b;
    }

    function add(uint256 a, uint256 b) internal pure returns (uint256) {
        uint256 c = a + b;
        assert(c >= a);
        return c;
    }
}

contract ERC20 {
    uint256 public totalSupply;
    function balanceOf(address who) public view returns (uint256);
    function transfer(address to, uint256 value) public returns (bool);
    event Transfer(address indexed from, address indexed to, uint256 value);
    function allowance(address owner, address spender) public view returns (uint256);
    function transferFrom(address from, address to, uint256 value) public returns (bool);
    function approve(address spender, uint256 value) public returns (bool);
    event Approval(address indexed owner, address indexed spender, uint256 value);
}

contract SWAP is Pausable, ERC20 {
    using SafeMath for uint256;
    event BatchTransfer(address indexed owner, bool value);
    event Locked(address indexed owner, uint256 value);
    event Unlocked(address indexed owner, uint256 value);
    event Mint(address indexed to, uint256 value);
    event Burn(address indexed from, uint256 value);

    string public name;
    string public symbol;
    uint8 public decimals;

    mapping (address => uint256) private balances;
    mapping (address => mapping (address => uint256)) internal allowed;
    mapping (address => uint256) private lockedBalances;

    constructor() public {
        name = "SWAP";
        symbol = "SWAP";
        decimals = 18;
        totalSupply = 3100000000 * 10 ** uint256(decimals);
        balances[msg.sender] = totalSupply;
    }

    function transfer(address _to, uint256 _value) whenNotPaused public returns (bool) {
        require(_to != address(0));
        if ((balances[msg.sender] >= lockedBalances[msg.sender]) && 
            (_value <= (balances[msg.sender] - lockedBalances[msg.sender])))
        {
            balances[msg.sender] = balances[msg.sender].sub(_value);
            balances[_to] = balances[_to].add(_value);
            emit Transfer(msg.sender, _to, _value);
            return true;
        }
        else
        {
            return false;
        }
    }

    function balanceOf(address _owner) public view returns (uint256 balance) {
        return balances[_owner];
    }

    function transferFrom(address _from, address _to, uint256 _value) public whenNotPaused returns (bool) {
        require(_to != address(0));
        require((balances[msg.sender] >= lockedBalances[msg.sender]) && (_value <= (balances[_from] - lockedBalances[_from])));
        require(_value <= allowed[_from][msg.sender]);

        balances[_from] = balances[_from].sub(_value);
        balances[_to] = balances[_to].add(_value);
        allowed[_from][msg.sender] = allowed[_from][msg.sender].sub(_value);
        emit Transfer(_from, _to, _value);
        return true;
    }

    function approve(address _spender, uint256 _value) public whenNotPaused returns (bool) {
        allowed[msg.sender][_spender] = _value;
        emit Approval(msg.sender, _spender, _value);
        return true;
    }

    function allowance(address _owner, address _spender) public view returns (uint256) {
        return allowed[_owner][_spender];
    }

    function lockedBalanceOf(address who) public view returns (uint256) {
        return lockedBalances[who];
    }

    function lock(address _owner, uint256 _value) public onlyOwner {
        uint256 available = balances[_owner].sub(lockedBalances[_owner]);
        require (available >= _value);
        lockedBalances[_owner] = lockedBalances[_owner].add(_value);
        emit Locked(_owner, _value);
    }

    function unlock(address _owner, uint256 _value) public onlyOwner {
        lockedBalances[_owner] = lockedBalances[_owner].sub(_value);
        emit Unlocked(_owner, _value);
    }

    function mint(address to, uint256 _value) onlyOwner public returns (bool success) {
		require (_value > 0); 
        balances[to] = SafeMath.add(balances[to], _value);                      
        totalSupply = SafeMath.add(totalSupply,_value);                                // Updates totalSupply
        emit Mint(to, _value);
        return true;
    }

    function burn(address from, uint256 _value) onlyOwner public returns (bool success) {
        require (balances[from] >= _value);            // Check if the sender has enough
		require (_value > 0); 
        balances[from] = SafeMath.sub(balances[from], _value);                         // Subtract from the sender
        totalSupply = SafeMath.sub(totalSupply,_value);                                // Updates totalSupply
        emit Burn(from, _value);
        return true;
    }
}
